import React, {Fragment} from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import axios from 'axios';

import logo from './logo.svg';
import './App.css';
import Typography from '@material-ui/core/Typography';
import SignIn from './SignIn';
import SignUp from './SignUp';

import Navbar from 'react-bootstrap/Navbar';
import Form from 'react-bootstrap/Form';
import FormControl from 'react-bootstrap/FormControl';
import { Button } from 'react-bootstrap';

export default function App() {
  return (
    <Router>

      <body>

        <Switch>
          <Route exact path="/">
            <SignIn />
          </Route>
          <Route path="/legacy">
            <Legacy />
          </Route>
          <Route path="/hall">
            <Hall />
          </Route>
          {/* <Route path="/lobby">
            <Lobby />
          </Route> */}
          <Route path="/signup">
            <SignUp />
          </Route>
        </Switch>
      </body>
    </Router>
  );
}

function Legacy() {
  return (
    <>
    <Nav />
    <div>
      <h2>Legacy</h2>
    </div>
    </>
  );
}

function Lobby(){
  return(
    <>
    <Nav />
    <div>
      <h2>Lobby</h2>
    </div>
    </>
  )
}

function Hall() {
  axios.get('http://localhost:8001/api/appointments')
  .then(function (response) {
    console.log(response.data);
  })
  return (
    <>
    <Nav />
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
    </>
  );
}

function Nav(){

  return(
    <Typography>
    <nav className ="navbar navbar-expand-lg navbar-light bg-light">
        <Link className ="navbar-brand"  to="/hall">LEVEL-UP</Link>
        <button className ="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
          <span className ="navbar-toggler-icon"></span>
        </button>
        <div className ="collapse navbar-collapse" id="navbarNav">
          <ul className ="navbar-nav mr-auto mt-2 mt-lg-0">
            <li className ="nav-item">
              <Link className ="nav-link" to="/legacy">Legacy</Link>
            </li>
            <li className ="nav-item">
              <Link className ="nav-link" to="/hall">Hall</Link>
            </li>
          </ul>
          <ul className ="navbar-nav ml-auto mt-2 mt-lg-0">
          <li className ="nav-item">
              <Link className ="nav-link" to="/">Logout</Link>
            </li>
          </ul>
        </div>
    </nav>
    <Navbar bg="light" expand="lg">
  <Navbar.Brand href="#home">LEVEL-UP</Navbar.Brand>
  <Navbar.Toggle aria-controls="basic-navbar-nav" />
  <Navbar.Collapse id="basic-navbar-nav">
    <Nav className="mr-auto">
      <Nav.Link href="/legacy">Legacy</Nav.Link>
      <Nav.Link href="/hall">Hall</Nav.Link>
      <Nav.Link href="/">Logout</Nav.Link>
    </Nav>
    <Form inline>
      <FormControl type="text" placeholder="Search" className="mr-sm-2" />
      <Button variant="outline-success">Search</Button>
    </Form>
  </Navbar.Collapse>
</Navbar>
    <hr />
  </Typography>
  )
  }
